import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Login from "./Component/Login"

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
          <Route exact path="/" component={(props) => (
            <Login {...props} />
          )} />

            <Route exact path="/signup" component={(props) => (
            <Register {...props} />
          )} /> 


      </Switch>
    </div>
  </Router>
  );
}

export default App;
